import React, {FC, PropsWithChildren} from 'react';
import cn from "classnames";

import s from "./styles.module.scss";

type TaskTableCellProps = PropsWithChildren<{
    header?: boolean;

    type?: string;
}>;

export const TaskTableCell: FC<TaskTableCellProps> = (props) => {
    const {children, header, type} = props;
    return (
        <th className={cn(s.taskTableCell, {
            [s.taskTableCell_name]: type === "name",
            [s.taskTableCell_status]: type === "status",
            [s.taskTableCell_tags]: type === "tags",
            [s.taskTableCell_header]: header,
        })}>
            {children}
        </th>
    );
};
